	def parse_item(self, response):
		item=GanjiItem()
		item["job1"]=response.xpath('//*[@class="title-line clearfix"]/h2/text()').extract_first()
		item["job2"]=response.xpath('//*[@class="title-line clearfix"]/p/text()').extract_first()
		item["salary"]=response.xpath('//*[@class="salary-line"]/b/text()').extract_first()
		item["want_numbers"]=response.xpath('//*[@class="description-label"]/span[1]/text()').extract_first()
		item["degree"]=response.xpath('//*[@class="description-label"]/span[2]/text()').extract_first()
		item["admissions"]=response.xpath('//*[@class="description-label"]/span[3]/text()').extract_first()
		item["experience"]=response.xpath('//*[@class="description-label"]/span[4]/text()').extract_first()
		item["age"]=response.xpath('//*[@class="description-label"]/span[5]/text()').extract_first()
		item["address"] =response.xpath('//*[@class="detail-map-top"]/text()').extract_first()
		item["url"] =response.url
		yield item

